export default function CountriesListNavigation() {
	return (
		<nav aria-label="Countries Search">
			<div className="">
				<label for="countries-search">O</label>
				<input
					type="text"
					placeholder="Search for a country..."
					id="countries-search"
				/>
			</div>
			<div></div>
		</nav>
	);
}
